import React from 'react'

class ListItems extends React.Component {
    render() {
        const { items } = this.props
        return(
            <div>
                <ul>
                    {
                        items.map((i, item) => (
                            <li key={i}>
                                <p>{item.name}</p>
                                <p>{item.price}</p>
                                <p>{item.type}</p>
                            </li>
                        ))
                    }
                </ul>
            </div>
        )
    }
}

export default ListItems
